import TypingCustom from './TypingCustom'
import Link from 'next/link';
import Fade from 'react-reveal/Fade';
import Typing from 'react-typing-animation';


const Header = () => (
    <div className='outestdiv'>
        <div className='outerdiv'>
            <div className='inner_outerdiv'>


                <div className='titlelogo'>
                    <Link href='/'>
                        <a>slern.io</a>
                    </Link>
                </div>
                <div className='signin'>
                    <Link href='/login'>
                        <a>Sign In</a>
                    </Link>
                </div>
            </div>
        </div>
        <div className='tagline'>
            <p>
                <span className='keyword'>for</span> <span className='variable'>cs_students</span> <span className='keyword'>by</span> <span className='variable'>cs_students</span>
            </p>
        </div>
        <style jsx>{`
        .outestdiv {

        }
        .tagline {
            text-align: center;
            padding-bottom: 50px;
            color: #486491;
            font-size: 40px;
            font-family: Courier; 
        }
        .keyword {
            font-weight: 700;
            color: #5A52FF;
        }

        .outerdiv {
            width: 100%;
            height: 60px;
            display: block;
            font-family: Arial; 
            font-size: 20px;
            background-color: black;
        }       

        .inner_outerdiv {
            width: 1000px;
            height: 100%;
            display: block;
            margin: 0 auto;
            background-color: red;

        }

        .titlelogo {
            color: #9B85F6;
            font-weight: bold;
            text-decoration: none;
            font-family: 'Arial';
            margin-left: 5px;
            margin-top: 5px;
        }
        .signin {
            color: #2181D5;
            font-weight: bold;
            font-family: 'Arial';
            margin-top: 5px;
            font-size: 20px;
            color: #9B85F6;
        }
        .signin:hover {
            opacity: 0.6;
        }
        a {
            text-decoration: none;
            font-family: 'Arial';
          }


        `}</style>
    </div>
);

export default Header;
